package com.models;import lombok.Builder;import lombok.Data;@Data@Builderpublic class ShipInfo {        private String firstName;    private String lastName;    private String zip;        public static ShipInfo builder( ){        return null;    }        public String getFirstName( ){        return firstName;    }        public void setFirstNameName( String firstName ){        this.lastName = firstName;    }        public String getLastName( ){                return lastName;    }        public void setLastName( String lastName ){                this.lastName = lastName;    }        public String getZip( ){                return zip;    }        public void setZip( String zip ){                this.zip = zip;    }}